CREATE TABLE [dbo].[Countries](
	[iso_code] [varchar](50)  PRIMARY KEY,
	[continent] [varchar](50) NULL,
	[country] [varchar](50) NULL,
	[median_age] [real] NULL,
	[aged_65_older] [real] NULL,
	[aged_70_older] [real] NULL,
	[gdp_per_capita] [real] NULL,
	[extreme_poverty] [real] NULL,
	[cardiovasc_death_rate] [real] NULL,
	[diabetes_prevalence] [real] NULL,
	[female_smokers] [real] NULL,
	[male_smokers] [real] NULL,
	[hospital_beds_per_thousand] [real] NULL,
	[life_expectancy] [real] NULL,
	[human_development_index] [real] NULL,
	[population] [int] NULL
) 
GO
/****** Object:  Table [dbo].[CovidData]    Script Date: 20/09/2023 21:05:42 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE TABLE [dbo].[CovidData](
	[iso_code] [varchar](50) NOT NULL FOREIGN KEY REFERENCES [Countries]([iso_code]),
	[country] [varchar](50) NULL,
	[report_date] [datetime] NOT NULL,
	[total_cases] [bigint] NULL,
	[new_cases] [bigint] NULL,
	[total_deaths] [bigint] NULL,
	[new_deaths] [int] NULL,
	[icu_patients] [bigint] NULL,
	[hosp_patients] [bigint] NULL,
	[weekly_hosp_admissions] [bigint] NULL,
	[total_tests] [bigint] NULL,
	[new_tests] [int] NULL,
	[total_vaccinations] [bigint] NULL,
	[people_vaccinated] [bigint] NULL,
	[people_fully_vaccinated] [bigint] NULL,
	[total_boosters] [bigint] NULL,
	[new_vaccinations] [int] NULL,
	CONSTRAINT PK_CovidData PRIMARY KEY ([iso_code],[report_date])
) 

